import React, { useState } from "react";
import { useSpring } from "react-spring";
import { SliderContainer, LeftArrow, RightArrow } from "./SliderElements";
import { sliderData } from "../../data/PokemonData";
import Slide from "../Slide";
import arrLeft from "../../assets/images/arrw-l.png";
import arrRight from "../../assets/images/arrw-r.png";

const Hero = () => {
  const { cosmog, corsola, bewear } = sliderData;
  return (
    <SliderContainer>
      <Slide
        img={cosmog.img}
        number={cosmog.number}
        name={cosmog.name}
        kanji={cosmog.kanji}
        bgColor={cosmog.bgColor}
      />
      <Slide
        img={corsola.img}
        number="#864"
        name="Corsola"
        kanji="サニーゴ"
        bgColor="#8F8F90"
      />
      <Slide
        img={bewear.img}
        number="#760"
        name="Bewear"
        kanji="キテルグマ"
        bgColor="#EDA5B3"
      />
      <LeftArrow arrow={arrLeft} />
      <RightArrow arrow={arrRight} />
    </SliderContainer>
  );
};

export default Hero;
